import React from 'react'
import ReactDOM from 'react-dom'

const Song = () => {
  return (
    <div>
      <iframe title = "pog" src="https://open.spotify.com/embed/track/1UGD3lW3tDmgZfAVDh6w7r" width="300" height="380" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
    </div>
  )
}

const App = () => {
  console.log('Hello from component')
  return (
    <div>
      <p>Hello world</p>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
